import React from "react";

const students = [
    {name: "Inje"},
    {name: "Steve"},
    {name: "Bill"},
    {name: "Jeff"}
];


function Attendancebook(props) {
    return (
        <ul>
            {students.map((student) => {
                return <li>{student.name}</li>
            })}
        </ul>
    )
}

export default Attendancebook;
